      "id": "strongly-recommended"
    }}>{`Strongly recommended:`}</h3>
    <p><a parentName="p" {...{
        "href": "https://marketplace.visualstudio.com/items?itemName=eamodio.gitlens"
      }}>{`GitLens - suppercharged`}</a></p>
