    <ul>
      <li parentName="ul">{`Mutating tsLint Behaviour --> tsLint is mutable, add remove rules from the `}<inlineCode parentName="li">{`tsconfig.js`}</inlineCode>{`. `}<a parentName="li" {...{
          "href": "https://palantir.github.io/tslint/rules/"
        }}>{`tsLint Rules`}</a></li>
    </ul>
    <p><a parentName="p" {...{
        "href": "https://marketplace.visualstudio.com/items?itemName=EditorConfig.EditorConfig"
      }}>{`EditorConfig for VS Code`}</a></p>
    <p><a parentName="p" {...{
        "href": "https://marketplace.visualstudio.com/items?itemName=streetsidesoftware.code-spell-checker"
      }}>{`Code Spell Check`}</a></p>
