      "id": "3-to-see-your-installed-installations-in-vscode-in-the-search-ext-marketplace-type"
    }}>{`3. To see your installed installations in vscode in the `}<inlineCode parentName="h4">{`search ext marketplace`}</inlineCode>{` type:`}</h4>
    <pre><code parentName="pre" {...{}}>{`    @installed // shows all extensions currently installed

    @enabled // enabled extensions

    @disabled // disabled extnensions

